import React, {Component} from 'react'
import './App.css';
import students from './data/students.json'

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            number: 0
        }
    }

    render() {
        return (
            <div>
                <button>delete all</button>
                {
                    students.map((student, index) => {
                        return (
                            <div className="student" key={student.id}>
                                <p>name: </p>
                                <p>age: </p>
                                <p>birthday:</p>
                                <p>address: </p>
                            </div>
                        )
                    })
                }
            </div>
        )
    }
}

export default App;
